import React, { useState } from 'react';
import './EditProfile.css'; // Ensure this file exists with the styling

const EditProfile = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    genderPreference: '',
    problemAreas: '',
    language: '',
    ageRange: '',
  });

  // Handle input field changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(
        'http://localhost:8000/api/users/update/675ec29bb1ea9e2fe694fdce', // Replace with your actual user ID
        {
          method: 'PUT',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(formData),
        }
      );

      const data = await response.json();
      if (response.ok) {
        alert('Profile updated successfully');
      } else {
        alert(`Error: ${data.message}`);
      }
    } catch (error) {
      console.error('Error:', error);
      alert('An error occurred. Please try again.');
    }
  };

  return (
    <div className="edit-profile-container">
      <h1>Edit Profile</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Password:</label>
          <input
            type="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label>Gender Preference:</label>
          <select
            name="genderPreference"
            value={formData.genderPreference}
            onChange={handleChange}
          >
            <option value="">Select Gender Preference</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="none">None</option>
          </select>
        </div>
        <div className="form-group">
          <label>Problem Areas:</label>
          <select
            name="problemAreas"
            value={formData.problemAreas}
            onChange={handleChange}
          >
            <option value="">Select Problem Area</option>
            <option value="anxiety">Anxiety</option>
            <option value="stress">Stress</option>
            <option value="depression">Depression</option>
            <option value="trauma">Trauma</option>
          </select>
        </div>
        <div className="form-group">
          <label>Language:</label>
          <select
            name="language"
            value={formData.language}
            onChange={handleChange}
          >
            <option value="">Select Language</option>
            <option value="english">English</option>
            <option value="spanish">Spanish</option>
            <option value="french">French</option>
          </select>
        </div>
        <div className="form-group">
          <label>Age Range:</label>
          <select
            name="ageRange"
            value={formData.ageRange}
            onChange={handleChange}
          >
            <option value="">Select Age Range</option>
            <option value="18-25">18-25</option>
            <option value="26-35">26-35</option>
            <option value="36-45">36-45</option>
            <option value="46+">46+</option>
          </select>
        </div>
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
};

export default EditProfile;
